import cv2
import numpy as np
import base64
from io import BytesIO
import matplotlib.pyplot as plt

def is_base64_image(base64_string):
    try:
        # Decode the base64 string into bytes
        image_bytes = base64.b64decode(base64_string)
        # Convert the bytes to a numpy array
        image_array = np.frombuffer(image_bytes, np.uint8)
        # Try to read the image using cv2
        image = cv2.imdecode(image_array, cv2.IMREAD_COLOR)
        if image is not None:
            return True, image
        else:
            return False, None
    except Exception as e:
        return False, None

# Sample base64 image string (replace this with your own)
base64_image = ""

is_image, image = is_base64_image(base64_image)

if is_image:
    # Display the image
    plt.imshow(cv2.cvtColor(image, cv2.COLOR_BGR2RGB))
    plt.axis('off')
    plt.show()
else:
    print("The input is not a valid base64 image.")


